import React from "react";
import ActivityTracker from "./ActivityTracker";
import YogaMeditation from "./YogaMeditation";
import AppointmentScheduler from "./AppointmentScheduler";
import ChatWithTherapist from "./ChatWithTherapist";
import MedicationReminder from "./MedicationReminder";
import ProgressDashboard from "./ProgressDashboard";
import DailyJournal from "./DailyJournal";
import EducationalResources from "./EducationalResources";

const Dashboard = () => {
  return (
    <div className="container-fluid py-4">
      <h2 className="mb-5 text-center fw-bold">Patient Dashboard</h2>
      <div className="row g-4">
        {/* Activity Tracker */}
        <div className="col-lg-4 col-md-6">
          <div
            className="rounded shadow text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1517964603305-9d8ce84394c2?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              padding: "20px",
              minHeight: "250px",
            }}
          >
            <ActivityTracker />
          </div>
        </div>

        {/* Yoga & Meditation */}
        <div className="col-lg-4 col-md-6">
          <div
            className="rounded shadow text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1506748686214-e9df14d4d9d0?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              padding: "20px",
              minHeight: "250px",
            }}
          >
            <YogaMeditation />
          </div>
        </div>

        {/* Appointment Scheduler */}
        <div className="col-lg-4 col-md-6">
          <div
            className="rounded shadow text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1584515933487-779824d29309?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              padding: "20px",
              minHeight: "250px",
            }}
          >
            <AppointmentScheduler />
          </div>
        </div>

        {/* Chat With Therapist */}
        <div className="col-lg-4 col-md-6">
          <div
            className="rounded shadow text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1585123246525-9c3e24c17d16?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              padding: "20px",
              minHeight: "250px",
            }}
          >
            <ChatWithTherapist />
          </div>
        </div>

        {/* Medication Reminder */}
        <div className="col-lg-4 col-md-6">
          <div
            className="rounded shadow text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1588712874918-1a6640f5a4cb?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              padding: "20px",
              minHeight: "250px",
            }}
          >
            <MedicationReminder />
          </div>
        </div>

        {/* Progress Dashboard */}
        <div className="col-lg-4 col-md-6">
          <div
            className="rounded shadow text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1511512578047-dfb367046420?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              padding: "20px",
              minHeight: "250px",
            }}
          >
            <ProgressDashboard />
          </div>
        </div>

        {/* Daily Journal */}
        <div className="col-lg-4 col-md-6">
          <div
            className="rounded shadow text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1516594798947-e65505dbb46f?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              padding: "20px",
              minHeight: "250px",
            }}
          >
            <DailyJournal />
          </div>
        </div>

        {/* Educational Resources */}
        <div className="col-lg-4 col-md-6">
          <div
            className="rounded shadow text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1573497491208-6b1acb260507?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              padding: "20px",
              minHeight: "250px",
            }}
          >
            <EducationalResources />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
